import React, { Component } from 'react';
import axios from 'axios'

export default class Region extends Component {
    state = {
        prop: []
    }

    componentDidMount() {
        axios.get('http://localhost:3001/propiedades')
            .then(res => {
                const prop = res.data;
                this.setState({ prop });
            })
    }

    render() {
        const { prop } = this.state

        return (
            <div>
                {prop.map(item => {
                        return (
                            <div key={item.id}>
                                <h3>{item.tittle}
                                    <li>{item.region}</li>
                                    <li>{item.caterogory}</li>
                                </h3>
                            </div>
                        )
                    }
                )}
            </div>
        )
    }
}
